import React from "react";
import './Equipos.css'

class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      menuOptions: ["Opción 1", "Opción 2", "Opción 3"],
    };
  }

  render() {
    return <Menu options={this.state.menuOptions} />;
  }
}
